import React from "react";
import { Card,Row,Col } from 'react-bootstrap'
import classes from './ExpenseDetails.module.css'

const ExpenseDetails= (props)=>{

    return(
        <React.Fragment>
            <li key={props.id}>{props.description}-{props.category}-{props.price}
                <button onClick={props.onEdit} className={classes.button} >Edit</button> 
                <button onClick={props.onDelete} className={classes.button} >Delete</button> 
            </li>
      
        
        </React.Fragment>
    )
}

export default ExpenseDetails
